import Link from 'next/link';

const Navbar=()=>(
    <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/about"><a>About</a></Link></li>
        </ul>

        <style jsx>{`
            ul {
                background : #444;
                display: flex;
                color : white;
                list-style:none;
            }

            ul li{
                color : white;
                padding: 10px;
            }

            ul li a{
                color : white;
            }
        `}</style>
    </div>
)

export default Navbar;
